  const [items, setItems]=useState([])
  const getItems = async () => {
    try {
      const response = await fetch('https://fakestoreapi.com/products');
      const data = await response.json();
      setItems(data);
      console.log(data);
    } catch (error) {
      console.log(error);
    }
  };
  useEffect(()=>{
    getItems();
  },[])

  return (
    <div className="App">
      <h1>
        FLAMING Flamingos!
      </h1>
        <Header/>
        <BodyImage/>
      <main>
      <Route exact path="/" render={()=><Shoes/>}/>
